/* How to set .conditions tags for a track, which regulate when it can be played:
  💥 The content of tracklist[i].conditions is an array. Example of evaluation of a .conditions element:
      [[{tag1:val1}],[{tag2:val2, tag3:val3}]] evaluates true when (tag1) || (tag2 && tag3). In other words,
      the top level array has elements evaluated with OR, and its elements are themselves arrays evaluated by AND.
  💥 Tags work as follows:
    (key)       (val)   (description, evaluates as true when:)
    ——————————————————————————————————————————————————————————————————————————
    turn>:      int     current turn number in the game is greater than val
    turn<:      int     current turn number in the game is less than val
    tech        string  player has tech
    gov         string  player has gov
    wonderplr,  string  player has wonder
    wonderwld,  string  world (is known to) possess wonder
    civ         string  val == style_string for player's nation (see "const styles = [...]" directly above)
    ❗️modality  string  if global music_modality equals this value, evaluates true. vals = {"peaceful", "battle"}
                           Current state of Progress on implementation of 'modality' tags:
                              1. ❗️if a global modality is on, make a way for all expressions without the modality tag to evaluate false
                                 (e.g. select ONLY intense battle music). For (2-5) to work, this will be a separate trait such as
                                 music_modality.only == true, with hard coding in .conditions to evaluate differently.
                              2. ✅if music_modality is set, then songs that HAVE a modality tag must match the tag.
                              3. ✅if music_modality is on, require this modality (done by an AND sub-operand in in all top-level operands)
                              4. ✅if music_modality is off, don't play a song of a certain modality (done by AND sub-operand in in all operands)
                              5. ✅if music_modality is off, play modality anyway (done by a separate operand so other operands eval true)
    priority    string  (val == "priority") makes this track a higher priority; i.e., queued first when it becomes legal
                        ❗️NB: needs other operand(s): does NOT reckon the legality of the track; by itself renders false,
                        this is not a logic tag but a priority tag. To make such track true, include separate operands
                        e.g. (P) || (O1) || (O2). (P)riority simply tags, (O1),(O2) will evaluate legality. (Can't do
                        a track with only (P) as it would always evaluate false.)

    "!" in front of the tag's key name, serves as NOT: evaluates false when true and vice versa: e.g. "!turn>" is equivalent to turn<=,
    example 2: {"!gov":"Despotism"} evaluates as (gov != Despotism)
*/

